  data for the administrative regions of China from 1950 to 1985. The data includes
  name and years of operation at a scale of one to one million (1:1M) at the county
  level. This dataset is produced in collaboration with the University of Washington
  as part of the China in Time and Space (CITAS) project and the Columbia University
  Center for International Earth Science Information Network (CIESIN).\",\n\t\"license_title\":
